import React from 'react';
import { Avatar, Box } from '@mui/material';

const spellNames = {
  21: 'Barrier',
  1: 'Cleanse',
  2202: 'SummonerFlash',  // This ID should be mapped to the name 'Flash'
  2201: 'Flee',
  14: 'Ignite',
  3: 'Exhaust',
  4: 'Flash',
  6: 'Ghost',
  7: 'Heal',
  13: 'Clarity',
  30: 'ToTheKing',
  31: 'PoroToss',
  11: 'Smite',
  39: 'Mark',
  32: 'Mark',
  12: 'Teleport',
  54: 'Placeholder',
  55: 'PlaceholderAndAttackSmite',
};

function SpellImages({ spells, version }) {
  return (
    <Box display="flex" gap={0.5}>
      {spells.map((spellId, index) => {
        const spellName = spellNames[spellId] || 'SummonerFlash';  // Fallback to 'SummonerFlash' if no match
        const spellImageUrl = `https://ddragon.leagueoflegends.com/cdn/${version}/img/spell/Summoner${spellName}.png`;

        return (
          <Avatar
            key={index}
            src={spellImageUrl}
            alt={`Spell ${spellName}`}
            sx={{ width: 32, height: 32 }}
          />
        );
      })}
    </Box>
  );
}

export default SpellImages;
